function Cabinet() {
  var classes = useStyles();
  var theme = useTheme();

  // local
  var [mainChartState, setMainChartState] = useState("monthly");

  // Recent Orders table

  const [order, setOrder] = React.useState("asc");
  const [orderBy, setOrderBy] = React.useState("price");
  const [selected, setSelected] = React.useState([]);
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(5);
  const [actionsButtonRefid, setActionsButtonRefid] =  React.useState(null);
  const [isActionsMenu, setActionsMenu] = React.useState(false)


  const handleRequestSort = (event, property) => {
    const isDesc = orderBy === property && order === "desc";
    setOrder(isDesc ? "asc" : "desc");
    setOrderBy(property);
  };

  const handleSelectAllClick = event => {
    if (event.target.checked) {
      const newSelecteds = rows.map(n => n.id);
      setSelected(newSelecteds);
      return;
    }
    setSelected([]);
  };

  const handleClick = (event, name) => {
    const selectedIndex = selected.indexOf(name);
    let newSelected = [];

    if (selectedIndex === -1) {
      newSelected = newSelected.concat(selected, name);
    } else if (selectedIndex === 0) {
      newSelected = newSelected.concat(selected.slice(1));
    } else if (selectedIndex === selected.length - 1) {
      newSelected = newSelected.concat(selected.slice(0, -1));
    } else if (selectedIndex > 0) {
      newSelected = newSelected.concat(
        selected.slice(0, selectedIndex),
        selected.slice(selectedIndex + 1)
      );
    }

    setSelected(newSelected);
  };

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  const isSelected = name => selected.indexOf(name) !== -1;

  const emptyRows =
    rowsPerPage - Math.min(rowsPerPage, rows.length - page * rowsPerPage);

  const randomData = React.useMemo(() => getRandomData(10), []);

  const mainChartData = React.useMemo(() => {
    var resultArray = [];
    var tablet = getRandomData(31, 3500, 6500, 7500, 1000);
    var desktop = getRandomData(31, 1500, 7500, 7500, 1500);
    var mobile = getRandomData(31, 1500, 7500, 7500, 1500);

    for (let i = 0; i < tablet.length; i++) {
      resultArray.push({
        tablet: tablet[i].value,
        desktop: desktop[i].value,
        mobile: mobile[i].value
      });
    }

    return resultArray;
  }, [mainChartState]); // eslint-disable-line

  return (
    <Grid container spacing={3}>
      <Grid item lg={3} sm={6} xs={12}>
        <Widget
          title="Support Tracker"
          bodyClass={classes.fullHeightBody}
          className={classes.card}
        >
          <Grid container spacing={3} alignItems="center">
            <Grid item xs={6}>
              <Box display="flex">
                <Typography variant="h2" weight="medium">
                  543
                </Typography>

                <Typography
                  color="text"
                  variant={"caption"}
                  noWrap
                  style={{ alignSelf: "flex-end", marginLeft: 8 }}
                >
                  Tickets
                </Typography>
              </Box>
            </Grid>
            <Grid
              item
              xs={6}
              style={{
                justifyContent: "center",
                alignItems: "center",
                display: "flex"
              }}
            >
              <Typography
                variant="caption"
                weight={"medium"}
                style={{ position: "absolute" }}
              >
                64%
              </Typography>
              <ResponsiveContainer width="100%" height={80}>
                <PieChart>
                  <Pie
                    data={TicketChartData}
                    startAngle={270}
                    endAngle={0}
                    paddingAngle={5}
                    innerRadius={30}
                    outerRadius={35}
                    dataKey="value"
                    style={{ border: 0 }}
                  >
                    {TicketChartData.map((entry, index) => (
                      <Cell
                        key={`cell-${index}`}
                        fill={theme.palette[entry.color].main}
                        stroke={""}
                      />
                    ))}
                  </Pie>
                </PieChart>
              </ResponsiveContainer>
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justify="space-between"
            alignItems="center"
            wrap={"nowrap"}
          >
            <Grid item>
              <Typography
                color="text"
                colorBrightness={"hint"}
                variant={"caption"}
                style={{ marginRight: 5 }}
                noWrap
              >
                New Tickets
              </Typography>
              <Box display="flex" alignItems="center" justifyContent={"center"}>
                <Typography
                  size="md"
                  weight={"medium"}
                  style={{ marginRight: 8 }}
                >
                  45
                </Typography>
                <Dot color="success" />
              </Box>
            </Grid>
            <Grid item>
              <Typography
                color="text"
                colorBrightness={"hint"}
                variant={"caption"}
                style={{ marginRight: 5 }}
              >
                Open
              </Typography>
              <Box display="flex" alignItems="center" justifyContent={"center"}>
                <Typography
                  size="md"
                  weight={"medium"}
                  style={{ marginRight: 8 }}
                >
                  147
                </Typography>
                <Dot color="warning" />
              </Box>
            </Grid>
            <Grid item>
              <Typography
                color="text"
                colorBrightness={"hint"}
                variant={"caption"}
              >
                Completed
              </Typography>
              <Box display="flex" alignItems="center" justifyContent={"center"}>
                <Typography
                  size="md"
                  weight={"medium"}
                  style={{ marginRight: 8 }}
                >
                  351
                </Typography>
                <Dot color="primary" />
              </Box>
            </Grid>
          </Grid>
        </Widget>
      </Grid>
      <Grid item lg={3} sm={6} xs={12}>
        <Widget
          title="Revenue Breakdown"
          className={classes.card}
          bodyClass={classes.alignStandaloneElement}
        >
          <Grid container spacing={3}>
            <Grid
              item
              xs={6}
              style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                padding: 6
              }}
            >
              <Typography
                variant={"caption"}
                weight={"medium"}
                style={{ position: "absolute" }}
              >
                1700
              </Typography>
              <ResponsiveContainer width="100%" height={144}>
                <PieChart>
                  <Pie
                    data={PieChartData}
                    innerRadius={30}
                    outerRadius={40}
                    dataKey="value"
